import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';

import CreateSong from './components/CreateSong';
import ShowSongList from './components/ShowSongList';
import ShowSongDetails from './components/ShowSongDetails';
import UpdateSongInfo from './components/UpdateSongInfo';

/*class App extends Component {
  render() {
    return (
      <Router>
      <Routes>
          <Route exact path='/' element={<ShowSongList/>} />
          <Route path='/create-song' element={<CreateSong/>} />
          <Route path='/edit-song/:id' element={<UpdateSongInfo/>} />
          <Route path='/show-song/:id' element={<ShowSongDetails/>} />
      </Routes>
      </Router>
    );
  }
}*/


class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <Route exact path='/' component={ShowSongList} />
          <Route path='/create-Song' component={CreateSong} />
          <Route path='/edit-Song/:id' component={UpdateSongInfo} />
          <Route path='/show-Song/:id' component={ShowSongDetails} />
        </div>
      </Router>
    );
  }
}
export default App;
